print 'Creacion catalogo cl_paises_restringidos'

declare @w_cod_tabla int

-- CREACION SI NO EXISTE
if not exists  (select 1 from  cobis..cl_tabla  where tabla = 'cl_paises_restringidos')
begin
   -- trae ultimo de cl_tabla
   select @w_cod_tabla= siguiente+1 from cobis..cl_seqnos where tabla = 'cl_tabla'

   -- actualiza seqnos de cl_tabla
   update cl_seqnos set siguiente=@w_cod_tabla where tabla = 'cl_tabla'
   print @w_cod_tabla

   -- crea tabla
   values(@w_cod_tabla, 'cl_paises_restringidos', 'PAISES RESTRINGIDOS')
end

-- CREACION DEL CATALOGO
if exists (select 1 from  cobis..cl_tabla  where tabla = 'cl_paises_restringidos')
begin
   -- obtiene el codigo de la tabla
   select @w_cod_tabla = codigo from cl_tabla where tabla = 'cl_paises_restringidos'

   --borrar el catalogo de esa tabla
   delete from cobis..cl_catalogo where tabla = @w_cod_tabla

   -- creacion del catalogo

   --catalogo_pro
   delete from cobis..cl_catalogo_pro where cp_producto = 'CLI' and cp_tabla=@w_cod_tabla
end
